-------------------------------------------------------------------------------------
--- INSERT into DriveScore table
-------------------------------------------------------------------------------------
declare @driverrank int;
declare @rating int;
declare @trend decimal(5,2);
declare @trendval varchar(20);
declare @rankchange int;
declare @upper int;
declare @lower int;
declare @random int;
declare @i integer; 

declare @brake bigint;
declare @fuel bigint;
declare @lane bigint;
declare @weather bigint;
declare @overallscore bigint;

set @upper = 1000
set @lower = 1
set @i = 1
while (@i <= @upper)
begin
       select @random = ROUND(((@upper - @lower -1) * RAND() + @lower), 0)
       if (@random >= 100)
              set @driverrank = ROUND(@random/100, 0)
       else if (@random < 100 AND @random > 10)
              set @driverrank = ROUND(@random/10, 0)
       IF (@driverrank <= 2)
       begin
              set @rating = 5
              set @trend = +0.5
              set @trendVal = convert(varchar(20), @trend) + '%'
              set @rankchange = +2
              set @brake = @random + 2000
              set @fuel = @random + 3000
              set @weather = @random + 2500
              set @lane = @random + 2700
              set @overallscore = @random + 4000

       end
       ELSE IF (@driverrank >= 3 AND @driverrank <= 8)
       begin
              set @rating = 4
              set @trend = +0.3
              set @trendVal = convert(varchar(20), @trend) + '%'
              set @rankchange = 0
              set @brake = @random + 1000
              set @fuel = @random + 2000
              set @weather = @random + 1500
              set @lane = @random + 1700
              set @overallscore = @random + 3000
       end
       ELSE IF (@driverrank > 8)
       begin
              set @rating = 2
              set @trend = -0.3 
              set @trendVal = convert(varchar(20), @trend) + '%'
              set @rankchange = -2
              set @brake = @random + 500
              set @fuel = @random + 1000
              set @weather = @random + 500
              set @lane = @random + 700
              set @overallscore = @random + 800
       end

       
       set @i = @i + 1

end;

